const Navbar = () => {
    return ( 
        <div className="navbar">
            <div className="logo">
                <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTzXrY24x9-WxFs2Ah-ej0u5FKjSQeIV-3JJA&usqp=CAU" alt="The office" />
                <ul>
                    <li><a href="">HOME</a></li>
                    <li><a href="">FAVOURTES</a></li>
                    <li><a href="">ADD TO FAV</a></li>
                    <li><a href="">LOG OUT</a></li>
                </ul>
            </div>
            <div className="nav_links"></div>
        </div>
     );
}
 
export default Navbar;
